import static java.lang.Integer.valueOf;
import static org.hamcrest.Matchers.*;

public class ArrayWithSizeMatcher {

    public static Matcher<List<?>> arrayWithSize(final String size) {

        return new BaseMatcher<List<?>>() {

            @Override
